import React, { useEffect, useState } from 'react';
import { getMyFeedback } from '../api/feedback';

export default function FeedbackPage() {
  const [items, setItems] = useState(null);
  const [error, setError] = useState('');
  const token = localStorage.getItem('token');

  useEffect(() => {
    (async () => {
      try {
        const res = await getMyFeedback(token);
        setItems(res.data || []);
      } catch (e) {
        setError('Failed to load your feedback.');
      }
    })();
  }, [token]);

  if (error) return <div style={{ padding: 16 }}>{error}</div>;
  if (items === null) return <div style={{ padding: 16 }}>Loadingâ€¦</div>;

  return (
    <div style={{ maxWidth: 800, margin: '40px auto', padding: '0 16px' }}>
      <h1>Feedback & Help</h1>
      <p>Thanks for helping us improve InfoNest. Use the feedback controls below each message, or leave general feedback here (coming soon).</p>
      {/* Add any additional components or links here */}
    </div>
  );
}
